import "./styles.css";
import Home from './Home'
import Product from './Product'

import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom'
import Header from './Header'

export default function App() {
  return (
    <div style={{homePage}} className="App">
    <BrowserRouter>
      <Switch>
       <Route path="/">
         <Header />
         <Home />
       </Route>
       <Route path="/:id">
         <Product />
       </Route>
      </Switch>
    </BrowserRouter>


    </div>
  );
}

const homePage = {
  width:"100%"
}
